import React from 'react'
import './CSS/Products.css'

const Products = ({item}) => {
  return (
    <div className='products-container'>
       <img src={item.img} alt='product'/>
       <label>{item.brand}</label>
       <label>{item.title}</label>
       <label>{item.price}</label>
    </div>
  )
}

export default Products
